import { Link } from "react-router-dom";

export function Footer() {
  return (
    <div className="bg-[#2B2B2B] w-full h-[7rem]">
      {" "}
      <Link to="/home">
        <p className="bg-[red] w-40  rounded h-12 text-[20px] font-bold font-sans hover:bg-red-600">
          Home
        </p>
      </Link>
    </div>
  );
}
